INSERT INTO `trs_event` (`idevent`, `tglevent`, `judulevent`, `tglkejadian`, `lokasi`, `peserta`, `uraian`) VALUES 
  (1,'2016-05-01','Buka Bersama','2017-05-02','Bandung','Pak Adung, Iding dan Udin','Saat Pusa Telah Tiba<br>'),
  (2,'2017-04-30','Ziarah kubur ke Bangunharja (CIAMIS) - HAHAL BILAHALA IDUL FITRI 1438H','2017-07-12','Makam Cikalong Wetan','Keluarga Ujungberung, Keluarga Jakarta dan Keluarga Banjaran','<br><p>Assalamu''alaikum Wr Wb.</p> \r\n<p style=\"text-align: justify\">Alhamdulillah walaupun tidak semua  anggota keluarga besar yang hadir, namun cukup untuk mewakili sebelum dimulainya bulan Ramadhan 1438 H untuk mengadakan pertemuan sambil ziarah ke makam leluhur.</p>\r\n<p style=\"text-align: justify\"> Pada pertemuan di Makam  dan ditindaklanjuti pertemuan internal pengurus  ada beberapa hal yang disepakati, antara lain:</p>\r\n<p style=\"text-align: justify; color:#D70016\">1)\tSilaturahmi keluarga besar Aki Tamami/ITA Suita Bangun Harja - Cisaga - Ciamis.</p>\r\n<p style=\"text-align: justify; color:#0001B7\">2) Ziarah Makam Uyut Martdjra, Aki Tamami, Nini Ita, Nenek Ocoh, Mang Warjo, Ua Rosip dan Ua Uya.<br></p>\r\n<p style=\"text-align: justify; color:#D70016\">3) Nginep di Rumah Bisuit dan Ua Ocip/Ua Ati</p><p style=\"text-align: justify; color:#D70016\">4) Acara Keluarga Mancing dan makan bersama</p><p style=\"text-align: justify; color:#D70016\">5) Bapak-Bapak Mancing di Muara Manjingklak - Pangandaran<br></p>');
COMMIT;

