#
# Definition for the `FU_SeqNext` function : 
#

DELIMITER $$

DROP FUNCTION IF EXISTS `FU_SeqNext`$$

CREATE DEFINER = 'root'@'localhost' FUNCTION `FU_SeqNext`(
        SeqName VARCHAR(20)
    )
    RETURNS varchar(50) CHARSET latin1
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE EXIT HANDLER FOR NOT FOUND
    RETURN  'NO DATA';
    update zsys_sequent
    set seq_next   =  IF((seq_next + 1) >= seq_max,1,seq_next + 1)
    where seq_name = SeqName;
    RETURN  "SUKSES";
END$$

#
# Definition for the `FU_SeqShow` function : 
#

DROP FUNCTION IF EXISTS `FU_SeqShow`$$

CREATE DEFINER = 'root'@'localhost' FUNCTION `FU_SeqShow`(
        SeqName VARCHAR(20)
    )
    RETURNS varchar(9) CHARSET latin1
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
 DECLARE vSeqNext INT DEFAULT 0;
 
 select IFNULL(seq_next,"0") INTO vSeqNext from zsys_sequent
 where seq_name = SeqName;
 IF vSeqNext = 0 THEN 
    INSERT INTO zsys_sequent 
    VALUES (SeqName,"1","999999999");
    select seq_next INTO vSeqNext from zsys_sequent
    where seq_name = SeqName;
 END IF;
 RETURN vSeqNext;
END$$

DELIMITER ;



